export interface DataTypeProperty {
    name: string;
    type: string;
}
export interface DataTypes {
    [additionalProperties: string]: DataTypeProperty[];
}
export interface TypedData {
    types: DataTypes;
    primaryType: string;
    domain: {
        name?: string;
        version?: string;
        chainId?: number;
        verifyingContract?: string;
        salt?: string;
    };
    message: Record<string, unknown>;
}
